import styles from './LandingPage.module.css';

export default function ContactInfo(props) {
  return (
    <div className={styles.contact_wrapper}>
      <div className={styles.info_wrapper} style={{ left: '10vw', width: '20vw', top: '200vh' }}>
        <div className={styles.info_paragraph}>
          The K5, described as a “fully autonomous” security robot, is part of a push by the mayor for more
          law-enforcement technology, which has raised concerns among privacy advocates.
        </div>
      </div>
      <div className={styles.info_wrapper} style={{ left: '10vw', width: '20vw', top: '280vh' }}>
        <div className={styles.info_paragraph}>
          The K5, described as a “fully autonomous” security robot, is part of a push by the mayor for more
          law-enforcement technology, which has raised concerns among privacy advocates.
        </div>
      </div>
    </div>
  );
}
